      "size": "5Gi"
      "storageClassName": ""
    "uid": 0
  "ingress":
    "enabled": false
  "nameOverride": "artifactory"
  "nginx":
    "enabled": false
  "postgresql":
    "enabled": false
  "serviceAccount":
    "create": true
    "name": "artifactory-artifactory"
"ocp-route":
  "app": "artifactory"
  "consoleLink":
